import React, { Component, Fragment } from 'react';
import './App.css';

class App extends Component {
  foo = () => 'Bars';

  render() {
    const name = 'John Doe';
    const loading = false;

    if (loading) {
      return <h4>Loading...</h4>
    }

    return (
      <div className='App'>
        <h1>Hello { name }</h1>
        <h1> Hello {name.toUpperCase() } </h1>
        <h1>Hello { this.foo() }</h1>
      </div>
    );
  }
}

export default App;
